import React from 'react';
import styled from 'styled-components';

const FooterContainer = styled.footer`
  background: var(--color-background-alt);
  padding: 20px 0;
  font-size: 12px;
  color: var(--color-text-secondary);
  border-top: 1px solid var(--color-border);
`;

const FooterContent = styled.div`
  max-width: 980px;
  margin: 0 auto;
  padding: 0 22px;
`;

const FooterGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(4, 1fr);
  gap: 20px;
  margin-bottom: 20px;

  @media (max-width: 768px) {
    grid-template-columns: repeat(2, 1fr);
  }

  @media (max-width: 480px) {
    grid-template-columns: 1fr;
  }
`;

const FooterColumn = styled.div`
  h3 {
    font-size: 12px;
    font-weight: 600;
    color: var(--color-text-primary);
    margin-bottom: 10px;
  }

  ul {
    list-style: none;
  }

  li {
    margin-bottom: 8px;
  }

  a {
    color: var(--color-text-secondary);
    transition: color 0.3s ease;

    &:hover {
      color: var(--color-text-primary);
    }
  }
`;

const FooterBottom = styled.div`
  border-top: 1px solid var(--color-border);
  padding-top: 20px;
  display: flex;
  justify-content: space-between;
  align-items: center;
  flex-wrap: wrap;
  gap: 10px;

  @media (max-width: 768px) {
    flex-direction: column;
    text-align: center;
  }
`;

const FooterLinks = styled.div`
  display: flex;
  gap: 20px;
  flex-wrap: wrap;

  @media (max-width: 768px) {
    justify-content: center;
  }
`;

const FooterLink = styled.a`
  color: var(--color-text-secondary);
  transition: color 0.3s ease;

  &:hover {
    color: var(--color-text-primary);
  }
`;

const Copyright = styled.p`
  color: var(--color-text-secondary);
`;

const Footer: React.FC = () => {
  return (
    <FooterContainer>
      <FooterContent>
        <FooterGrid>
          <FooterColumn>
            <h3>Shop and Learn</h3>
            <ul>
              <li><a href="#">Store</a></li>
              <li><a href="#">Mac</a></li>
              <li><a href="#">iPad</a></li>
              <li><a href="#">iPhone</a></li>
              <li><a href="#">Watch</a></li>
            </ul>
          </FooterColumn>
          <FooterColumn>
            <h3>Services</h3>
            <ul>
              <li><a href="#">Apple Music</a></li>
              <li><a href="#">Apple TV+</a></li>
              <li><a href="#">Apple Fitness+</a></li>
              <li><a href="#">iCloud</a></li>
            </ul>
          </FooterColumn>
          <FooterColumn>
            <h3>Apple Store</h3>
            <ul>
              <li><a href="#">Find a Store</a></li>
              <li><a href="#">Genius Bar</a></li>
              <li><a href="#">Today at Apple</a></li>
              <li><a href="#">Apple Camp</a></li>
            </ul>
          </FooterColumn>
          <FooterColumn>
            <h3>About</h3>
            <ul>
              <li><a href="#">Newsroom</a></li>
              <li><a href="#">Apple Leadership</a></li>
              <li><a href="#">Career Opportunities</a></li>
              <li><a href="#">Investors</a></li>
            </ul>
          </FooterColumn>
        </FooterGrid>
        <FooterBottom>
          <Copyright>Copyright Â© {new Date().getFullYear()} Apple Inc. All rights reserved.</Copyright>
          <FooterLinks>
            <FooterLink href="#">Privacy Policy</FooterLink>
            <FooterLink href="#">Terms of Use</FooterLink>
            <FooterLink href="#">Sales and Refunds</FooterLink>
            <FooterLink href="#">Legal</FooterLink>
            <FooterLink href="#">Site Map</FooterLink>
          </FooterLinks>
        </FooterBottom>
      </FooterContent>
    </FooterContainer>
  );
};

export default Footer;
